import React from "react";

const AppHeader = () => {
    return (
        <div>
            <div><h1>My Todo List</h1></div>
            <div>
                <nav className="navbar navbar-light bg-light">
                <span className="navbar-text">
                    Navbar text with an inline element
                </span>
                </nav>
            </div>
        </div>

    )
}

export default AppHeader;
